import React from 'react';

function add(s1,s2) {
	return (s1+s2);
	// body...
}


function sub(s1,s2) {
	return (s1-s2);
	// body...
}


function mul(s1,s2) {
	return (s1*s2);
	// body...
}


function div(s1,s2) {
	return (s1/s2);
	// body...
}
